// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

contract MultiSigWallet {
    // === STORAGE ===
    address[] public owners;
    mapping(address => bool) public isOwner;
    uint256 public required;
    uint256 public transactionCount;
    uint256 public dailyLimit;
    uint256 public spentToday;
    uint256 public lastDay;
    
    struct Transaction {
        address to;
        uint256 value;
        bytes data;
        bool executed;
        uint256 confirmations;
    }
    
    mapping(uint256 => Transaction) public transactions;
    mapping(uint256 => mapping(address => bool)) public confirmations;
    mapping(address => uint256) public executionNonce;
    mapping(bytes32 => bool) public executedHashes;
    
    // Time locks
    mapping(uint256 => uint256) public executionTime;
    uint256 public executionDelay = 2 days;
    
    // Recovery system
    address public recoveryAddress;
    uint256 public recoveryTime;
    bool public recoveryInitiated;
    
    // Events
    event Deposit(address indexed sender, uint256 amount);
    event Submission(uint256 indexed transactionId);
    event Confirmation(address indexed sender, uint256 indexed transactionId);
    event Execution(uint256 indexed transactionId);
    event ExecutionFailure(uint256 indexed transactionId);
    event RecoveryInitiated(address indexed initiator, uint256 unlockTime);
    event RecoveryExecuted(address indexed newOwner);
    
    // Errors
    error NotOwner();
    error InvalidRequired();
    error TransactionNotConfirmed();
    error TransactionAlreadyExecuted();
    error InsufficientConfirmations();
    error ExecutionTimeNotReached();
    error DailyLimitExceeded();
    error ZeroAddress();
    error AlreadyConfirmed();
    error RecoveryNotInitiated();
    error RecoveryTimeNotReached();
    error TransactionFailed();
    
    // Modifiers
    modifier onlyWallet() {
        if (!isOwner[msg.sender]) revert NotOwner();
        _;
    }
    
    modifier ownerDoesNotExist(address owner) {
        if (isOwner[owner]) revert("Owner exists");
        _;
    }
    
    modifier ownerExists(address owner) {
        if (!isOwner[owner]) revert NotOwner();
        _;
    }
    
    modifier transactionExists(uint256 transactionId) {
        if (transactions[transactionId].to == address(0)) revert("Transaction does not exist");
        _;
    }
    
    modifier confirmed(uint256 transactionId, address owner) {
        if (!confirmations[transactionId][owner]) revert TransactionNotConfirmed();
        _;
    }
    
    modifier notConfirmed(uint256 transactionId, address owner) {
        if (confirmations[transactionId][owner]) revert AlreadyConfirmed();
        _;
    }
    
    modifier notExecuted(uint256 transactionId) {
        if (transactions[transactionId].executed) revert TransactionAlreadyExecuted();
        _;
    }
    
    modifier notNull(address addr) {
        if (addr == address(0)) revert ZeroAddress();
        _;
    }

    // === CONSTRUCTOR ===
    constructor(
        address[] memory _owners,
        uint256 _required,
        uint256 _dailyLimit,
        address _recoveryAddress
    ) {
        require(_owners.length > 0, "Owners required");
        require(_required > 0 && _required <= _owners.length, "Invalid required number");
        require(_recoveryAddress != address(0), "Invalid recovery address");
        
        for (uint256 i = 0; i < _owners.length; i++) {
            require(_owners[i] != address(0), "Invalid owner");
            require(!isOwner[_owners[i]], "Duplicate owner");
            
            isOwner[_owners[i]] = true;
            owners.push(_owners[i]);
        }
        
        required = _required;
        dailyLimit = _dailyLimit;
        recoveryAddress = _recoveryAddress;
        lastDay = block.timestamp;
    }
    
    // === CORE MULTISIG FUNCTIONS ===
    function submitTransaction(
        address to,
        uint256 value,
        bytes memory data
    ) public onlyWallet notNull(to) returns (uint256) {
        uint256 transactionId = transactionCount;
        
        transactions[transactionId] = Transaction({
            to: to,
            value: value,
            data: data,
            executed: false,
            confirmations: 0
        });
        
        transactionCount += 1;
        executionTime[transactionId] = block.timestamp + executionDelay;
        
        emit Submission(transactionId);
        confirmTransaction(transactionId);
        
        return transactionId;
    }
    
    function confirmTransaction(uint256 transactionId) 
        public 
        onlyWallet 
        transactionExists(transactionId) 
        notConfirmed(transactionId, msg.sender) 
        notExecuted(transactionId) 
    {
        confirmations[transactionId][msg.sender] = true;
        transactions[transactionId].confirmations += 1;
        
        emit Confirmation(msg.sender, transactionId);
    }
    
    function executeTransaction(uint256 transactionId) 
        public 
        onlyWallet 
        transactionExists(transactionId) 
        notExecuted(transactionId) 
    {
        Transaction storage txn = transactions[transactionId];
        
        // Check confirmations
        if (txn.confirmations < required) revert InsufficientConfirmations();
        
        // Check time lock
        if (block.timestamp < executionTime[transactionId]) revert ExecutionTimeNotReached();
        
        // Check daily limit
        _updateDailySpent();
        if (spentToday + txn.value > dailyLimit) revert DailyLimitExceeded();
        
        // Execute transaction
        txn.executed = true;
        spentToday += txn.value;
        
        (bool success, ) = txn.to.call{value: txn.value}(txn.data);
        if (!success) {
            txn.executed = false;
            spentToday -= txn.value;
            revert TransactionFailed();
        }
        
        emit Execution(transactionId);
    }
    
    function revokeConfirmation(uint256 transactionId) 
        public 
        onlyWallet 
        transactionExists(transactionId) 
        notExecuted(transactionId) 
        confirmed(transactionId, msg.sender) 
    {
        confirmations[transactionId][msg.sender] = false;
        transactions[transactionId].confirmations -= 1;
    }
    
    // === DAILY LIMIT MANAGEMENT ===
    function _updateDailySpent() internal {
        if (block.timestamp > lastDay + 24 hours) {
            spentToday = 0;
            lastDay = block.timestamp - (block.timestamp % 24 hours);
        }
    }
    
    function setDailyLimit(uint256 newLimit) public onlyWallet {
        dailyLimit = newLimit;
    }
    
    // === RECOVERY SYSTEM ===
    function initiateRecovery() public onlyWallet {
        require(!recoveryInitiated, "Recovery already initiated");
        
        recoveryInitiated = true;
        recoveryTime = block.timestamp + 7 days;
        
        emit RecoveryInitiated(msg.sender, recoveryTime);
    }
    
    function executeRecovery() public {
        require(recoveryInitiated, "Recovery not initiated");
        require(block.timestamp >= recoveryTime, "Recovery time not reached");
        require(msg.sender == recoveryAddress, "Not recovery address");
        
        // Transfer ownership to recovery address
        for (uint256 i = 0; i < owners.length; i++) {
            isOwner[owners[i]] = false;
        }
        
        owners = [recoveryAddress];
        isOwner[recoveryAddress] = true;
        required = 1;
        recoveryInitiated = false;
        
        emit RecoveryExecuted(recoveryAddress);
    }
    
    function cancelRecovery() public onlyWallet {
        require(recoveryInitiated, "Recovery not initiated");
        recoveryInitiated = false;
    }
    
    // === WALLET MANAGEMENT ===
    function addOwner(address owner) 
        public 
        onlyWallet 
        notNull(owner) 
        ownerDoesNotExist(owner) 
    {
        isOwner[owner] = true;
        owners.push(owner);
        
        // Update required confirmations if needed
        if (required > owners.length) {
            required = owners.length;
        }
    }
    
    function removeOwner(address owner) public onlyWallet ownerExists(owner) {
        isOwner[owner] = false;
        
        for (uint256 i = 0; i < owners.length - 1; i++) {
            if (owners[i] == owner) {
                owners[i] = owners[owners.length - 1];
                break;
            }
        }
        
        owners.pop();
        
        if (required > owners.length) {
            required = owners.length;
        }
    }
    
    function changeRequirement(uint256 newRequired) public onlyWallet {
        require(newRequired > 0 && newRequired <= owners.length, "Invalid required");
        required = newRequired;
    }
    
    function changeExecutionDelay(uint256 newDelay) public onlyWallet {
        executionDelay = newDelay;
    }
    
    // === VIEW FUNCTIONS ===
    function getConfirmationCount(uint256 transactionId) public view returns (uint256) {
        return transactions[transactionId].confirmations;
    }
    
    function isConfirmed(uint256 transactionId) public view returns (bool) {
        return transactions[transactionId].confirmations >= required;
    }
    
    function getOwners() public view returns (address[] memory) {
        return owners;
    }
    
    function getConfirmations(uint256 transactionId) public view returns (address[] memory) {
        address[] memory confirmationsList = new address[](owners.length);
        uint256 count = 0;
        
        for (uint256 i = 0; i < owners.length; i++) {
            if (confirmations[transactionId][owners[i]]) {
                confirmationsList[count] = owners[i];
                count++;
            }
        }
        
        // Resize array
        address[] memory result = new address[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = confirmationsList[i];
        }
        
        return result;
    }
    
    function getTransactionIds(
        uint256 from,
        uint256 to,
        bool pending,
        bool executed
    ) public view returns (uint256[] memory) {
        uint256[] memory transactionIds = new uint256[](transactionCount);
        uint256 count = 0;
        
        for (uint256 i = 0; i < transactionCount; i++) {
            if (pending && !transactions[i].executed || executed && transactions[i].executed) {
                if (from <= i && i <= to) {
                    transactionIds[count] = i;
                    count++;
                }
            }
        }
        
        // Resize array
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = transactionIds[i];
        }
        
        return result;
    }
    
    // Allow contract to receive ETH
    receive() external payable {
        if (msg.value > 0) {
            emit Deposit(msg.sender, msg.value);
        }
    }
}

